try {
	var type = $('fhirType').toLowerCase();
	var id = $('fhirId');
	var requestURL = $('url');
	if (!requestURL.endsWith('/')) {
		requestURL += '/';
	}
	var requestURL = new java.net.URI(requestURL);
	var contentType = $('contentType');
	var isFormatXML = !FhirUtil.isMIMETypeJSON($('parameters').getParameter('_format') || contentType || 'xml');

	var _count = $('parameters').getParameter('_count');
	if (_count) {
		_count = parseInt(_count, 10);
		if (!_count) {
			return createOperationOutcome('error', 'invalid', 'Parameter _count formatted incorrectly: ' + $('parameters').getParameter('_count'));
		}
	}

	var _since = $('parameters').getParameter('_since');
	if (_since) {
		try {
			_since = DateUtil.formatDate('yyyy-MM-dd HH:mm:ss.SSSX', new InstantDt(_since).getValue());
		} catch (e) {
			return createOperationOutcome('error', 'invalid', 'Parameter _since formatted incorrectly: ' + _since);
		}
	}

	// Build up the WHERE clause and prepared query parameters
	var whereParts = [];
	var params = [];

	if (type && id) {
		// history-instance
		whereParts.push("name = ?");
		whereParts.push("id = ?");
		params.push(type);
		params.push(id);
	} else if (type) {
		// history-type
		whereParts.push("name = ?");
		params.push(type);
	}

	if (_since) {
		whereParts.push("last_modified >= ?::TIMESTAMP WITH TIME ZONE");
		params.push(_since);
	}

	// Build up the actual query
	var query = "SELECT name, id, version, data::TEXT, mimetype, deleted, request_method, request_url FROM resource";
	if (whereParts.length > 0) {
		query += " WHERE " + whereParts.join(" AND ");
	}
	query += " ORDER BY name ASC, id ASC, version DESC";
	if (_count > 0) {
		query += " LIMIT " + _count;
	}

	var result = executeCachedQuery(query, params);
	var bundle = new Packages.ca.uhn.fhir.model.dstu2.resource.Bundle().setType(BundleTypeEnum.HISTORY_LIST);

	while (result.next()) {
		var entryType = result.getString('name');
		var entryId = result.getString('id');
		var entryVersion = result.getInt('version');
		var entryData = result.getString('data');
		var entryContentType = result.getString('mimetype');
		var entryDeleted = result.getBoolean('deleted');
		var entryRequestMethod = result.getString('request_method');
		var entryRequestURL = result.getString('request_url');

		var resourceType = ResourceTypeEnum.VALUESET_BINDER.fromCodeString(entryType);
		if (resourceType != null) {
			entryType = resourceType.getCode();
		}

		var request = new Packages.ca.uhn.fhir.model.dstu2.resource.Bundle.EntryRequest().setMethod(HTTPVerbEnum.valueOf(entryRequestMethod)).setUrl(entryRequestURL);
		var entry = bundle.addEntry().setRequest(request);

		if (!entryDeleted) {
			var relativeUrl = '../';
			if (id) {
				relativeUrl += '../';
			}
			entry.setFullUrl(requestURL.resolve(relativeUrl + entryId + '/_history/' + entryVersion).toString());
			entry.setResource(FhirUtil.fromXML(entryData));
		}
	}

	bundle.setTotal(bundle.getEntry().size());

	var message = isFormatXML ? FhirUtil.toXML(bundle) : FhirUtil.toJSON(bundle);
	var contentType = isFormatXML ? FhirUtil.getMIMETypeXML() : FhirUtil.getMIMETypeJSON();
	responseMap.put('response', FhirResponseFactory.getHistoryResponse(message, 200, contentType));
	return $r('response').getMessage();
} catch (e) {
	return createOperationOutcome('error', 'transient', 'Error retrieving resource history.', 500, e);
}

try {
	var type = $('fhirType').toLowerCase();
	var requestURL = $('url');
	if (!requestURL.endsWith('/')) {
		requestURL += '/';
	}
	var requestURL = new java.net.URI(requestURL);
	var contentType = $('contentType');
	var isFormatXML = !FhirUtil.isMIMETypeJSON($('parameters').getParameter('_format') || contentType || 'xml');

	// Add more supported parameters as you see fit
	var supportedParameters = [
		// General
		'_format',
		// All resources
		'_id',
		'_lastupdated',
		// Results
		'_count',
	]

	// Add more supported parameters as you see fit
	var supportedTypeParameters = {
		patient: [
			'identifier',
			'name',
			'given',
			'family'
		],
		schedule: [
			'identifier',
			'actor'
		],
		slot: [
			'identifier',
			'schedule'
		]
	}

	if (type) {
		var typeParameters = supportedTypeParameters[type.toLowerCase()];
		if (typeParameters) {
			for each (param in typeParameters) {
				supportedParameters.push(param);
			}
		}
	}

	// Reject requests with parameters that aren't supported
	for each (key in $('parameters').getKeys().toArray()) {
		if (supportedParameters.indexOf(key.toLowerCase()+'') < 0) {
			return createOperationOutcome('error', 'invalid', 'Unknown or unsupported parameter ' + key + '.');
		}
	}

	var _id = $('parameters').getParameter('_id');

	var _lastUpdated = $('parameters').getParameter('_lastUpdated');
	if (_lastUpdated) {
		try {
			_lastUpdated = DateUtil.formatDate('yyyy-MM-dd HH:mm:ss.SSSX', new DateDt(_lastUpdated).getValue());
		} catch (e) {
			return createOperationOutcome('error', 'invalid', 'Parameter _lastUpdated formatted incorrectly: ' + _lastUpdated);
		}
	}

	var _count = $('parameters').getParameter('_count');
	if (_count) {
		_count = parseInt(_count, 10);
		if (!_count) {
			return createOperationOutcome('error', 'invalid', 'Parameter _count formatted incorrectly: ' + $('parameters').getParameter('_count'));
		}
	}

	// Build up the WHERE clause and prepared query parameters
	var whereParts = [];
	var params = [];

	if (type) {
		// search-type
		whereParts.push(" name = ?");
		params.push(type);
	}

	if (_id) {
		whereParts.push("id = ?");
		params.push(_id);
	}

	if (_lastUpdated) {
		whereParts.push("DATE_TRUNC('day', last_modified) = DATE_TRUNC('day', ?::TIMESTAMP WITH TIME ZONE)");
		params.push(_lastUpdated);
	}

	// Add resource-specific query expressions
	if (type == 'patient') {
		if ($('parameters').contains('identifier')) {
			addXPath(xpathSearch('/*/identifier', ['value/@value'], $('parameters').getParameter('identifier'), true, true), whereParts, params);
		}
		if ($('parameters').contains('name')) {
			addXPath(xpathSearch('/*/name', ['family/@value', 'given/@value'], $('parameters').getParameter('name')), whereParts, params);
		}
		if ($('parameters').contains('family')) {
			addXPath(xpathSearch('/*/name', ['family/@value'], $('parameters').getParameter('family')), whereParts, params);
		}
		if ($('parameters').contains('given')) {
			addXPath(xpathSearch('/*/name', ['given/@value'], $('parameters').getParameter('given')), whereParts, params);
		}
	} else if (type == 'schedule') {
		if ($('parameters').contains('identifier')) {
			addXPath(xpathSearch('/*/identifier', ['value/@value'], $('parameters').getParameter('identifier'), true, true), whereParts, params);
		}
		if ($('parameters').contains('actor')) {
			addXPath(xpathSearch('/*/actor', ['reference/@value'], $('parameters').getParameter('actor')), whereParts, params);
		}
	} else if (type == 'slot') {
		if ($('parameters').contains('identifier')) {
			addXPath(xpathSearch('/*/identifier', ['value/@value'], $('parameters').getParameter('identifier'), true, true), whereParts, params);
		}
		if ($('parameters').contains('schedule')) {
			addXPath(xpathSearch('/*/schedule', ['reference/@value'], $('parameters').getParameter('schedule')), whereParts, params);
		}
	}

	// Build up the actual query
	var query = "SELECT name, id, version, data::TEXT, mimetype, request_method, request_url FROM resource r1 WHERE version = (SELECT MAX(version) FROM resource r2 WHERE r2.name = r1.name AND r2.id = r1.id) AND (deleted IS NULL OR deleted = FALSE)";
	if (whereParts.length > 0) {
		query += " AND " + whereParts.join(" AND ");
	}
	query += " ORDER BY name ASC, id ASC, version DESC";
	if (_count > 0) {
		query += " LIMIT " + _count;
	}

	var result = executeCachedQuery(query, params);
	var bundle = new Packages.ca.uhn.fhir.model.dstu2.resource.Bundle().setType(BundleTypeEnum.SEARCH_RESULTS);

	while (result.next()) {
		var entryType = result.getString('name');
		var entryId = result.getString('id');
		var entryVersion = result.getInt('version');
		var entryData = result.getString('data');
		var entryContentType = result.getString('mimetype');
		var entryRequestMethod = result.getString('request_method');
		var entryRequestURL = result.getString('request_url');

		var resourceType = ResourceTypeEnum.VALUESET_BINDER.fromCodeString(entryType);
		if (resourceType != null) {
			entryType = resourceType.getCode();
		}

		var request = new Packages.ca.uhn.fhir.model.dstu2.resource.Bundle.EntryRequest().setMethod(HTTPVerbEnum.valueOf(entryRequestMethod)).setUrl(entryRequestURL);
		var entry = bundle.addEntry().setRequest(request);

		var relativeUrl = '';
		if ($('url').contains('_search') && $('method') == 'POST') {
			relativeUrl = '../';
		}
		entry.setFullUrl(requestURL.resolve(relativeUrl + entryId + '/_history/' + entryVersion).toString());
		entry.setResource(FhirUtil.fromXML(entryData));
	}

	bundle.setTotal(bundle.getEntry().size());;

	var message = isFormatXML ? FhirUtil.toXML(bundle) : FhirUtil.toJSON(bundle);
	contentType = isFormatXML ? FhirUtil.getMIMETypeXML() : FhirUtil.getMIMETypeJSON();
	responseMap.put('response', FhirResponseFactory.getHistoryResponse(message, 200, contentType));
	return $r('response').getMessage();
} catch (e) {
	return createOperationOutcome('error', 'transient', 'Error searching resources.', 500, e);
}

/**
	Creates an XPath search selector within the given base node.

	@param String base - The base path to select within.
	@param String[] nodes - An array of child nodes to select by (combined with OR operator).
	@param String value - The value to test.
	@param Boolean equals - If true, the test will be equality, otherwise it will be a contains.
	@param Boolean caseSensitive - If true, the contains test will match using case sensitivity.
	@return The built-up contains selector.
*/
function xpathSearch(base, nodes, value, equals, caseSensitive) {
	var search = base + "[";
	value = new java.lang.String(value).replaceAll("'", "''");
	if (!caseSensitive) {
		value = value.toLowerCase();
	}

	for (var i = 0; i < nodes.length; i++) {
		var node = nodes[i];
		if (!caseSensitive) {
			node = xpathTranslate(node);
		}

		if (equals) {
			search += node + " = '" + value + "'";
		} else {
			search += "contains(" + node + ", '" + value + "')";
		}

		if (i < nodes.length - 1) {
			search += " or ";
		}
	}

	search += "]";
	return search;
}

/**
	Wraps a value in the XPath translate method for case insensitive selecting.

	@param String value - The value to wrap.
	@return The translate method string.
*/
function xpathTranslate(value) {
	return "translate(" + value + ", 'ABCDEFGHIJKLMNOPQRSTUVWXYZ', 'abcdefghijklmnopqrstuvwxyz')";
}

