	var contentType = $('headers').getHeader('Content-Type');
	var resource;

	if (org.apache.commons.lang.StringUtils.equalsIgnoreCase(contentType, FhirUtil.getMIMETypeXML()) || org.apache.commons.lang.StringUtils.equalsIgnoreCase(contentType, FhirUtil.getMIMETypeJSON())) {
		resource = FhirUtil.isMIMETypeXML(contentType) ? FhirUtil.fromXML(message) : FhirUtil.fromJSON(message);
