	} else {
		var attachmentId = addAttachment(message, contentType).getAttachmentId();
		resource = FhirUtil.createBinaryResource(attachmentId, contentType);
	}

	// Always return XML for Binary resources
	return FhirUtil.toXML(resource);
}

